      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE col2 * - 51 / + 16 NOT BETWEEN col2 * - - 69 * col2 - + col0 * + 31 AND ( col0 + col0 );
  - name: tab0

outputs:
